import React from 'react';
import Case from './Case';


class Raw extends React.Component{
  constructor(props) {
    super(props);
  }

  render() {
      return (
        <div className={"raw"+props.aorb}>
          <Case aorb={this.props.aorb}></Case>
        </div>
      );
  }
}


export default Raw;
